                                    /** @description The unique ID of the main account. Returns empty if the account does not have any main account. */
                                    main_account_name?: string;
                                    /** @description Main account alias, same as the format shown on the Table View. Return empty if the account does not have any main account. */
                                    main_account_alias?: string;
                                    /** @description Account tag. Return empty if the account does not have any tag. */
                                    account_tag_list?: string[];
                                    /** @description Account tag alias, same as the format shown on the Table View. Return empty if the account does not have any tag. */
